import React from 'react'
import { render } from 'react-dom'
import { Router, Route, Link } from 'react-router-dom'

export default class NavBar extends React.Component{
    render(){
        return(
            <div>
                <ul>
                    <Link to={{pathname:'./profile'}}>Profile Page</Link>
                    <Link to={{pathname:'./AllCharacters'}}>All Characters</Link>
                    <Link to={{pathname:'./NewClass'}}>Create New Character</Link>
                </ul>
            </div>
        )
    }
}
